from Comfy.comfy_info import ComfyLocatorsfrom Comfy.comfy_model import ComfyStoredef start_comfy_wacom():    comfy = ComfyStore()    items = comfy.generate_info(url=ComfyLocators.wacom_url)    return comfy.compare_data_xp_pen(items, ComfyLocators.COMFY_WACOM_ARICLES)def start_comfy_xp_pen():    comfy = ComfyStore()    items = comfy.generate_info(url=ComfyLocators.xp_pen_url)    return comfy.compare_data_xp_pen(items, ComfyLocators.COMFY_XP_PEN_ARTICLES)